  false,\n\t\"url\": null,\n\t\"notes\": \"Solar-Geophysical Data (SGD) reports were
  a comprehensive compilation of many different kinds of observational data of the
  sun's activity and its effects on the Earth. Data from the worldwide network of
  geophysical and solar observatories were compiled each month. The data began to
  be complied in November 1955 and ended in September 2009. SGD helped keep researchers
  informed of the major events on the sun and associated interplanetary, ionospheric,
  radio propagation and other geophysical effects. This report series was made possible
  through the cooperation of many observatories, laboratories and agencies worldwide.
  Data included: daily maps of the sun showing active regions, daily sunspot information,
  event data such as solar radio and flare events, satellite data such as solar wind
  and interplanetary magnetic field measurements, cosmic ray data, geomagnetic activity
  data, and ionospheric propagation indices. The SGD was divided into two reports,
  the Prompt Report contained data available for one and two months before the report
  publication date and the Comprehensive Report that contained data that became available
  six months after the report publication date.\",\n\t\"license_title\": null,\n\t\"extras\":
